import React from 'react';

export default function About() {
  return (
    <div>
      <h1>About Me</h1>
      <img id="headshot" src="./Assets/Headshot.jpg" alt="headshot"/>
      <p>
      I am a new web-developer, eager to master new coding languages. I graduated from the University of Washington with a Bachelor in Science. I am currently attending the UW Coding Bootcamp for Full Stack Web Development. 
      My passion for coding unique solutions drove me to make this career shift and pursue frontend development. 
      I put considerable effort into creating efficient, accessible, user-friendly applications, 
      and it is something I am passionate about pursuing more of.
      </p>
    </div>
  );
}
